const keys = Object.keys(rootData);

const data = keys.map(k => {
    const WalletCount = (rootData[k].accounts_created || 0) - (rootData[k].AccountDelete || 0);
    counter += WalletCount;
    return Object.assign({}, rootData[k],  {
        date: new Date(k).toLocaleDateString('en-US'),
        WalletCount: WalletCount,
        WalletSumCount: counter,
    });
});

                data: data,
                pointStyle: false,

        options: {

                    beginAtZero: true
                }
            },
            parsing: {

const totalWallet = (() => {
    return keys
        .map(i => (rootData[i].accounts_created || 0) - (rootData[i].AccountDelete || 0))
        .reduce((sum, count) => {
            sum += count;
            return sum;
        }, 0);
})();
